adff-fbc7-11e9-a5d6-080027405b36?v=full"}],"resourceVersion":"1.9"},{"display":"Other","uuid":"895cafd0-fbc7-11e9-a5d6-080027405b36","name":"Other","locale":"en","localePreferred":true,"conceptNameType":"FULLY_SPECIFIED","links":[{"rel":"self","uri":"http://192.168.33.33/openmrs/ws/rest/v1/concept/895cab7b-fbc7-11e9-a5d6-080027405b36/name/895cafd0-fbc7-11e9-a5d6-080027405b36"},{"rel":"full","uri":"http://192.168.33.33/openmrs/ws/rest/v1/concept/895cab7b-fbc7-11e9-a5d6-080027405b36/name/895cafd0-fbc7-11e9-a5d6-080027405b36?v=full"}],"resourceVersion":"1.9"}],"displayString":"Other","resourceVersion":"2.0","translationKey":"OTHER_2"}],"properties":{"allowDecimal":null}},"units":null,"hiNormal":null,"lowNormal":null,"hiAbsolute":null,"lowAbsolute":null,"events":{"onValueChange":"function (form) {
    var manageWoundAssessmentConcepts = function () {
        var woundAssessmentSections = form.find(form.rootRecord, 'Wound Assessment');
        for (var i = 0; i < woundAssessmentSections.length; i++) {
            var woundHide = window.OPDProgressNoteMD.isMultiSelectOtherHidden(form.get('OPN, Site of wound', i));
            if (woundHide) {
                form.get("OPN, Site of wound, other", i).hideAndClear();
            } else {
                form.get("OPN, Site of wound, other", i).setHidden(woundHide);
            }
            var frequncyHide = window.OPDProgressNoteMD.isMultiSelectOtherHidden(form.get('OPN, Frequency of dressing', i));
            if (frequncyHide) {
                form.get("OPN, Frequency of dressing, other", i).setHidden(true);
            } else {
                form.get("OPN, Frequency of dressing, other", i).setHidden(frequncyHide);
            }
        }
    };

    function addSelectedMultiSelectValues() {
        var multi_select = form.get('OPN, Reason for visit').currentRecord.value.value;
        var length = multi_select == undefined ? 0 : multi_select.length;
        var selectedValuesArray = [];
        for (var i = 0; i < length; i++) {
            var name = multi_select[i].displayString == undefined ? multi_select[i].name : multi_select[i].displayString;
            if (name !== undefined) {
                selectedValuesArray.push(name);
            }
        }
        return selectedValuesArray;
    }

    var selectedValuesArray = addSelectedMultiSelectValues();
    if (selectedValuesArray.length > 0) {
        if (selectedValuesArray.includes('Wound follow-up')) {
            form.get('Wound Assessment').setHidden(false);
            manageWoundAssessmentConcepts();
        } else {
            form.get('Wound Assessment').hideAndClear();
        }
        if (selectedValuesArray.includes('Other')) {
            form.get('OPN, Reason for visit, other').setHidden(false);
        } else {
            form.get('OPN, Reason for visit, other').hideAndClear();
        }
        if ((selectedValuesArray).includes('Follow-up') || (selectedValuesArray).includes('Mutual session')) {
            form.get('OPN, Summary of follow-up consultation').setHidden(false);
        } else {
            form.get('OPN, Summary of follow-up consultation').hideAndClear();
        }
        if (selectedValuesArray.includes('Pain Visit')) {
            form.get('Pain management').setHidden(false);
            if (form.get("OPN, Type of pain experienced by the patient").getValue() === "Nociceptive") {
                form.get("Nociceptive pain").setHidden(false);
                form.get("OPN, Side of pain").setHidden(false);
                form.get("OPN, Site of pain").setHidden(false);
                var hide = window.OPDProgressNoteMD.isMultiSelectOtherHidden(form.get('OPN, Site of pain'))
                if (hide) {
                    form.get("OPN, Site of pain, other").hideAndClear();
                } else {
                    form.get("OPN, Site of pain, other").setHidden(hide);
                }
                form.get("OPN, When does the pain occur").setHidden(false);
                var hide = window.OPDProgressNoteMD.isMultiSelectOtherHidden(form.get('OPN, When does the pain occur'))
                if (hide) {
                    form.get("OPN, When does the pain occur, other").hideAndClear();
                } else {
                    form.get("OPN, When does the pain occur, other").setHidden(hide);
                }
                form.get("OPN, Occurrence of the pain").setHidden(false);
                form.get("OPN, What triggers or makes the pain worse").setHidden(false);
                form.get("OPN, What helps or relieves the pain").setHidden(false);
                form.get("OPN, Current pain medication").setHidden(false);
                form.get("OPN, Comments and notes about pain status of patient").setHidden(false);
                form.get("Questionnaire DN4").setHidden(true);

            } else if (form.get("OPN, Type of pain experienced by the patient").getValue() === "Neuropathic") {
                form.get("Nociceptive pain").setHidden(true);
                form.get("OPN, Side of pain").setHidden(false);
                form.get("OPN, Site of pain").setHidden(false);
                var hide = window.OPDProgressNoteMD.isMultiSelectOtherHidden(form.get('OPN, Site of pain'))
                if (hide) {
                    form.get("OPN, Site of pain, other").hideAndClear();
                } else {
                    form.get("OPN, Site of pain, other").setHidden(hide);
                }
                form.get("OPN, When does the pain occur").setHidden(false);
                var hide = window.OPDProgressNoteMD.isMultiSelectOtherHidden(form.get('OPN, When does the pain occur'))
                if (hide) {
                    form.get("OPN, When does the pain occur, other").hideAndClear();
                } else {
                    form.get("OPN, When does the pain occur, other").setHidden(hide);
                }
                form.get("OPN, Occurrence of the pain").setHidden(false);
                form.get("OPN, What triggers or makes the pain worse").setHidden(false);
                form.get("OPN, What helps or relieves the pain").setHidden(false);
